comment_text:
Video di oggi dell'avv. Fusillo che spiega come difendersi dalle richieste di GP: fare video si può dichiarando che serviranno per la propria tutela legale e per denunciare abusi all'autorità, poi seguono i consigli nelle varie situazioni.
Un breve PDF si può scaricare e portarsi dietro lo si può trovare [qui
](

"Ieri sera ero a una cena coi 20 avvocati che hanno pubblicato una pagina su Il Resto del Carlino contro il Green Pass. Eravamo senza GP e senza mascherina, al Ristorante La Quercia di Novilara, il cui proprietario ha pubblicamente annunciato che non applica il Green Pass. La serata è trascorsa bene, ma verso la fine sono entrati vigili  e poliziotti mascherati a verificare i GP o, in mancanza, a fornire le generalità per la multa. Si è scatenato un quieto inferno, con avvocati  che chiedevano: 
- la delega del MinSal per eseguire i controlli; 
- la certificazione del corso sulla privacy del dati; 
- la metodologia usata per cancellare i dati personali dopo il controllo. 
Infine, si è citato l’art 28 della Costituzione che rende i pubblici ufficiali personalmente responsabili degli atti che compiono nell’esercizio delle loro funzioni. Sotto questo fuoco di sbarramento, vigile e poliziotti se ne sono andati. E anche noi ce ne siamo andati, sempre senza GP, senza mascherina e senza multa…"

Il video che riprende il momento in cui salta in aria l'auto di Ivan Sushko, rappresentante cittadino di Mikhailovka nell'oblast di Zaparozhye.

Kiev potrebbe aver iniziato la strategia del terrore contro singoli personaggi filo-russi o di spicco sulla falsa riga di quanto già avvenuto durante la 1° guerra ucraina scoppiata nel 2014, quando furono sistematicamente uccisi, tramite attentati dinamitardi, tutti i leader separatisti del Donbass che avevano battuto sul campo l'esercito ucraino, costringendolo ad un umiliante ritirata:

-  "Motorola" comandante del battaglione Sparta morto nel 2016 a causa di una bomba piazzata nel suo ascensore ;

- il Comandante "Givi" del Battaglione Somalia morto a Donetsk l'8 febbraio 2017 ucciso con un missile; 

- il capo dell'autoproclamata Repubblica Popolare di Donetsk Aleksandr Zakharchenko morto nella stessa città il 31 agosto 2018 tramite un ordigno esplosivo.
